import React from 'react'
import { Button, Form, FormControl, Nav, NavDropdown } from 'react-bootstrap'
import Navbar from 'react-bootstrap/Navbar'
import {Avatar} from "@material-ui/core";
import './NavbarComponent.css'
import { auth, provider } from './firebase';
import { useAuthState } from 'react-firebase-hooks/auth';

function NavbarComponent() {
    const [user,loading]=useAuthState(auth);
    const SignIn=e=>{
        e.preventDefault();
        auth.signInWithPopup(provider).catch((error)=>alert(error.message ));

    };

    return (
        <div>
           <>
  <Navbar className="color-nav"  >
  
  
   
    <Nav className="mr-auto">
        
      
     {user ? (
         <>
         <Avatar style={{ marginRight:"20px"}}src={user?.photoURL}/>
         <Navbar.Brand style={{color:"green"}}href="#home">{user?.displayName}</Navbar.Brand>
      <Button  className="mr-2" variant="outline-success" type="submit" onClick={()=>auth.signOut()}>Logout</Button>
     </>
     ):(
        <Button  className="mr-2" variant="outline-success" type="submit" onClick={SignIn}>Login</Button>
     ) }
      <Button  className="mr-2"  variant="outline-success">Donate</Button>
      <Button   className="mr-2" variant="outline-success">Demand</Button>
    </Nav>
    <Form inline>
      <FormControl style={{color:"green"}}type="text" placeholder="Search" className="mr-sm-2" />
      <Button variant="outline-success">Search</Button>
    </Form>
  </Navbar>
  

  
</>
        </div>
    )
}

export default NavbarComponent
